 So, when you click on a Tooltip, the previous one should close. But how?

To solve this, we can use React Context to manage the state of the currently open Tooltip. Here's a step-by-step approach:

1. **Create a Context**:
   - Create a context to hold the ID of the currently active Tooltip.

2. **Provider Component**:
   - Create a provider component that wraps your app or the part where Tooltips are used. This provider will manage the state of the active Tooltip ID.

3. **Tooltip Component**:
   - Each Tooltip component should use the context to check if it's the active one.
   - When a Tooltip is clicked, it updates the context with its ID.
   - If another Tooltip is clicked, the context updates, causing the previous Tooltip to close.

Here's an example implementation:

**Step 1: Create the Context**

```javascript
// contexts/TooltipContext.js
import { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ activeTooltip, setActiveTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
```

**Step 2: Wrap Your App with the Provider**

```javascript
// pages/_app.js
import { TooltipProvider } from '../contexts/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

**Step 3: Create the Tooltip Component**

```javascript
// components/Tooltip.js
import { useTooltip } from '../contexts/TooltipContext';
import { useState, useRef, useEffect } from 'react';

const Tooltip = ({ id, content, children }) => {
  const { activeTooltip, setActiveTooltip } = useTooltip();
  const [isOpen, setIsOpen] = useState(false);
  const tooltipRef = useRef(null);

  useEffect(() => {
    setIsOpen(activeTooltip === id);
  }, [activeTooltip, id]);

  const handleClick = () => {
    if (activeTooltip === id) {
      setActiveTooltip(null);
    } else {
      setActiveTooltip(id);
    }
  };

  return (
    <div className="relative" ref={tooltipRef}>
      <button onClick={handleClick}>{children}</button>
      {isOpen && (
        <div className="absolute bg-gray-800 text-white p-2 rounded">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

**Usage in a Page**

```javascript
// pages/index.js
import Tooltip from '../components/Tooltip';

export default function Home() {
  return (
    <div>
      <Tooltip id="tooltip1" content="Tooltip 1 Content">
        Hover over me 1
      </Tooltip>
      <Tooltip id="tooltip2" content="Tooltip 2 Content">
        Hover over me 2
      </Tooltip>
    </div>
  );
}
```

**Explanation**:
- The `TooltipProvider` manages the state of the active Tooltip ID.
- Each `Tooltip` component checks if it's the active one using the context.
- Clicking a Tooltip toggles its state, closing any previously open Tooltip.

