## Vad är en SP3 fil?

En fil med filtillägget .sp3 är ett satellitbanaformat för National Geodetic Survey (NGS) för att lagra baninformation. Detta är ett utökat format av SP1 och SP2 NGS-format som inkluderar information om satellitklockkorrigeringar tillsammans med banor, såsom P-kod (P1 och P2) och C-kodprocesser. Det är främst baserat på position och klocka, men innehåller inte hastigheter. Formatet föreslogs av Remondi 1989 och antogs av NGS 1991. Utöver information om klockkorrigeringar inkluderar det information som exakthetsindikatorer, kommentarsrader, GPS-veckonummer och sekundära epoker som är associerade med banor. SP3-filer kan öppnas med Wolfram Research Mathematica.

## SP3 filformat - Mer information

SP3-filer sparas på skiva i ASCII-filformat och deras innehåll kan öppnas i valfri textredigerare för visning. Strukturen för en SP3-fil kan ses från följande bild.

