First, make sure that the service account you're using to generate the custom token has the "Firebase Authentication Admin" role in the Google Cloud Console. This grants the necessary permissions to create custom tokens.

Next, verify that the UID you're using is a string that uniquely identifies the guest user. Since these are guest users, you might want to generate a unique identifier each time a guest session starts. You could use a combination of a timestamp and a random string to ensure uniqueness.

